import React from 'react';
import "../Asserts/Css/ComponentsCss/Malaysia.css";
import Malaysia from "../Asserts/images/Malaysia.png";

const MalaySia  = () => {
  return (
    
      <div className="malaysiacomponents">
        {" "}
       <a href="/Internmalaysia"><img className='malaysiacomponentsimg' src={Malaysia} width="320px" height="274px" ></img></a> 
        <p className="malaysiacomponentsone">Malaysia </p>
        <p className='malaysiacomponentstwo'>Get your Intership in USA  </p>
      </div>
    
  );
};

export default MalaySia ;
